import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
// import Menu from './components/menu';
import React from 'react';
// import Categories from './components/categories';
// import Navbar from './components/navbar'
import './styles/warning.css'
// import Cart from './components/cart.jsx'
import Adminlogin from './components/adminlogin.jsx';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/homepage';
import Chef from './components/chef.jsx';

function App() {

  // const [orderisdone, setorderisdone] = React.useState(false);

  const orderdone = async() => {
    const response = await fetch("http://localhost:3001/mysite/orders/order/", {
      method: "PATCH",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({ ispending: true}),
    })
  }

  return (
    <React.Fragment>
      <Router>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path="/adminlogin" element={<Adminlogin />} />
          <Route path="/chef" element={<Chef />} />
        </Routes>
      </Router>
    </React.Fragment>

  );
}

export default App;
